const initialStateState={}
const product=(state=initialStateState,action)=>{
    switch(action.type){
        case 'FETCH-ITEM-PRODUCT':
            console.log("khac nhau",action.product)
            state=action.product;
            console.log(state)
           return state
          default: return state
    }
}
export default product;
